import { GET_ITEMS } from "../actions/constants";

const initialState={
    notes:[
        {title:"1",detail:'1'},
        {title:"2",detail:'2'},
        {title:"3",detail:'3'}
    ]
}

export default function(state=initialState,action){
    switch (action.type) {
        case GET_ITEMS:
            return{
                ...state
            }    
        default:
            return state
    }
}
